        "title": "What If a Needle Hits the Earth at the Speed of Light?",
        "description": "We are accustomed to expect danger from outer space. Huge, almost unexplored space, hostile to humans. Nothing surprising. But what about something‚Ä¶ small? For example, an ordinary sewing needle. What if it ends up in space... accelerates to the speed of light... and then crashes into our planet?\n\n#eldddir #eldddir_space #eldddir_disaster #eldddir_earth",
